import React, { Component } from 'react';
import '../css/tab_css.css';
// import Catelog from './Catelog';
import tesla from '../images/icons/tesla_icon.jpg';
import lexus from '../images/icons/lexus_icon.png';
// import hyundai from '../images/icons/hyundai.jpeg';
// import mercedes from '../images/icons/mercedes.jpeg';
import { Link } from 'react-router-dom';

const company_name = [
  {
    company: 'electric',
    url: '/electric',
    icon_url: tesla,
  },
  {
    company: 'sedan',
    url: '/sedan',
    icon_url: lexus,
  },
  {
    company: 'hatchBack',
    url: '/hatchBack',
    icon_url: lexus,
  },
  {
    company: 'suv',
    url: '/suv',
    icon_url: lexus,
  },
  {
    company: 'covertibles',
    url: '/convertibles',
    icon_url: lexus,
  },
  {
    company: 'luxary',
    url: '/luxary',
    icon_url: lexus,
  },
  {
    company: 'premium',
    url: '/premium',
    icon_url: lexus,
  },
  {
    company: 'offRoad',
    url: 'offRoad',
    icon_url: lexus,
  },
  {
    company: 'popular',
    url: '/popular',
    icon_url: lexus,
  },
  {
    company: 'sports',
    url: '/sports',
    icon_url: lexus,
  },
];

class Tabs extends Component {
  constructor(props) {
    super(props);
    this.state = { car: 'Electric' };
  }
  // catelog = (name) => {
  //   console.log(name);
  //   this.setState({ car: name });
  // };
  render() {
    // var cat = () => {
    //   console.log(this);
    // };
    return (
      <div>
        <div className="tablet">
          {company_name.map((n) => (
            <div className="tab">
              <Link
                to={{
                  pathname: `/${n.company}`,
                  model_type: n.company,
                }}
              >
                <img alt="icon" src={n.icon_url} />
              </Link>
            </div>
          ))}
        </div>
        {/* 
        <div className="cat">
          <Catelog />
        </div> */}
      </div>
    );
  }
}

export default Tabs;
